import { Transactionstable } from "../TransactionsTable";

import { Container } from "./styles";

interface DashboardProps {
    onthemeTooggle: () => void;
}

export function Dashboard({ onthemeTooggle }: DashboardProps) {
    return (
        <Container>
            <Summary />
            <Transactionstable />
        </Container>
    )
}
